import React, { useState } from 'react';


function SignUp() {
  const [form, setForm] = useState({
    email: '',
    dateOfBirth: '',
    phone: '',
    username: '',
    password: '',
    repassword: '',
  });
  const [isSuccessful, setIsSuccessful] = useState(false);
  const [isSignUpFailed, setIsSignUpFailed] = useState(false);
  const [errorMessage, setErrorMessage] = useState('');

  const handleChange = (e) => {
    const { name, value } = e.target;
    setForm({ ...form, [name]: value });
  };

  const handleSubmit = () => {
    // Exemple de validation simple
    if (form.password === form.repassword) {
      setIsSuccessful(true);
      setIsSignUpFailed(false);
    } else {
      setIsSignUpFailed(true);
      setErrorMessage("Les mots de passe saisis ne correspondent pas.");
    }
  };

  return (
    <div className="form-login">
      <div className="card card-container">
        <h2 className="form-login-heading">Inscrivez-vous maintenant</h2>
        {!isSuccessful ? (
          <div className="login-wrap">
            <div className="form-row">
              <div className="col-6">
                <label>E-mail</label>
                <input
                  type="email"
                  className="form-control"
                  name="email"
                  placeholder="Email"
                  value={form.email}
                  onChange={handleChange}
                  required
                />
                {form.email === '' && <small className="text-danger">Champ obligatoire</small>}
              </div>
              <div className="col-6">
                <label>Date de naissance</label>
                <input
                  type="date"
                  className="form-control"
                  name="dateOfBirth"
                  value={form.dateOfBirth}
                  onChange={handleChange}
                  required
                />
                {form.dateOfBirth === '' && <small className="text-danger">Champ obligatoire</small>}
              </div>
            </div>

            <div className="form-row">
              <div className="col-6">
                <label>Téléphone</label>
                <input
                  type="tel"
                  className="form-control"
                  name="phone"
                  placeholder="Téléphone"
                  value={form.phone}
                  onChange={handleChange}
                  required
                  minLength="8"
                />
                {form.phone.length < 8 && <small className="text-danger">Le numéro doit comporter 8 chiffres</small>}
              </div>
              <div className="col-6">
                <label>Nom d'utilisateur</label>
                <input
                  type="text"
                  className="form-control"
                  name="username"
                  placeholder="Nom d'utilisateur"
                  value={form.username}
                  onChange={handleChange}
                  required
                  minLength="3"
                  maxLength="20"
                />
                {(form.username.length < 3 || form.username.length > 20) && (
                  <small className="text-danger">Nom d'utilisateur doit comporter 3-20 caractères</small>
                )}
              </div>
            </div>

            <div className="form-row">
              <div className="col-6">
                <label>Mot de passe</label>
                <input
                  type="password"
                  className="form-control"
                  name="password"
                  placeholder="Mot de passe"
                  value={form.password}
                  onChange={handleChange}
                  required
                  minLength="6"
                />
                {form.password.length < 6 && <small className="text-danger">Le mot de passe doit contenir 6 caractères</small>}
              </div>
              <div className="col-6">
                <label>Confirmez le mot de passe</label>
                <input
                  type="password"
                  className="form-control"
                  name="repassword"
                  placeholder="Mot de passe"
                  value={form.repassword}
                  onChange={handleChange}
                  required
                  minLength="6"
                />
                {form.repassword && form.repassword !== form.password && (
                  <small className="text-danger">Les mots de passe saisis ne correspondent pas</small>
                )}
              </div>
            </div>

            <button className="btn btn-theme btn-block" onClick={handleSubmit} type="button">
              <i className="fa fa-lock"></i> S'inscrire
            </button>

            {isSignUpFailed && <div className="alert alert-warning">L'inscription a échoué !<br />{errorMessage}</div>}
          </div>
        ) : (
          <div className="success">Vous vous êtes inscrit avec succès</div>
        )}
      </div>
    </div>
  );
}

export default SignUp;
